import React from 'react';
import { FiExternalLink } from 'react-icons/fi';

export default function ProjectCard({ p, index }) {
  return (
    <article className="project-card reveal" data-index={index} style={{ ['--delay']: `${index * 140}ms` }}>
      <div className="project-split">
        <div className="project-media" aria-hidden>
          <div className="media-layer">
            <div className="media-accent">{p.title.split(' ')[0]}</div>
          </div>
        </div>

        <div className="project-info">
          <h3 className="project-title">{p.title}</h3>
          <p className="project-desc">{p.desc}</p>

          {p.title.includes('Rootworm') && (
            <ul className="project-bullets">
              <li>ESP32, acoustic driver, low-frequency design</li>
              <li>ESP-NOW wireless comms for field units</li>
              <li>Energy-efficient waveform generation</li>
            </ul>
          )}
          {p.title.includes('Delta') && (
            <ul className="project-bullets">
              <li>Delta kinematics and inverse kinematics</li>
              <li>Camera-based part detection and servo control</li>
            </ul>
          )}
          {p.title.includes('Self-Balancing') && (
            <ul className="project-bullets">
              <li>IMU sensor fusion, encoder feedback</li>
              <li>PID & LQR controllers and obstacle avoidance</li>
            </ul>
          )}
          {p.title.includes('LED Matrix') && (
            <ul className="project-bullets">
              <li>STM32F411RE, 74HC595 shift-register multiplexing</li>
              <li>Bitwise buffers and animation timing</li>
            </ul>
          )}

          <div className="project-links">
            {p.link ? (
              <a href={p.link} target="_blank" rel="noopener noreferrer" className="view-btn">
                <FiExternalLink className="view-icon"/> View
              </a>
            ) : (
              <a href="#" className="view-btn"><FiExternalLink className="view-icon"/> View</a>
            )}
          </div>
        </div>
      </div>
    </article>
  );
}
